script: |
  super -f text -I q10288.spq | sort > q10288.out

inputs:
  - name: q10288.spq
    data: |
      SELECT DISTINCT + col2 FROM tab0 (FORMAT parquet) WHERE NOT - 89 + + col2 + + col2 / col2 * + 63 * + - 82 >= + 5 * + col2;
  - name: tab0

outputs:
  - name: q10288.out
    data: |
      10
      47
      99
